import React from 'react';
import Cardlist from './Cardlist';
import { robots } from './robots.js';

const App = () => {
    return (
    <>
        <h1>RoboFriends</h1>
        <Searchbox />
        <Cardlist robots={robots}/>
    </>
    );
}

export default App;
